import React, { useEffect } from 'react';
import {useSelector, useDispatch} from 'react-redux';
import { getClubs } from "../../store/clubs";
import ClubsCard from '../ClubsCard';
import styles from '../Clubs/ClubsPage.module.css'

const ClubsPage = () => {
  const dispatch = useDispatch();

  useEffect(async() => {
    await dispatch(getClubs())
  }, [dispatch])

  const clubs = useSelector(state => Object.values(state.clubs))

  return (
    <div>
      {clubs.map((club) => (
        <ClubsCard className={styles.clubCard} club={club}/>
      ))}

    </div>
  )
}

export default ClubsPage;
